Swallow Me Whole
Publisher:  Top Shelf Productions
Publication Date:  November 19, 2008

Written and illustrated by Nate Powell

In his most ambitious book to date, Nate Powell quietly explores the dark corners of adolescence--not the cliched melodramatic outbursts of rebellion, but the countless tiny moments of madness, the vague relief of medication, and mixed blessing of family ties. As the story unfolds, two step-siblings hold together amidst schizophrenia, obsessive compulsive disorder, family breakdown, animal telepathy, misguided love, and the tiniest hope that everything will someday make sense.

